script: |
  super -f text -I q5125.spq | sort > q5125.out

inputs:
  - name: q5125.spq
    data: |
      SELECT - ( + ( col0 ) ) * col1 + - - ( - col0 ) + + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN NULL AND ( - 75 ) * 55 + CAST ( - col1 AS INTEGER );
  - name: tab0

outputs:
  - name: q5125.out
    data: |
